  const [text, setText] = useState('');
  return (
    <>
      <form onSubmit={onSubmitHandler}>
        <input type="text" placeholder="Введите новую задачу"></input>
        <button type="submit">Добавить</button>
      </form>
    </>
  );
};
export default TodoForms;
